INSERT IGNORE INTO `mitarbeiter` (`MitarbeiterNr`, `Nachname`, `Vorname`, `Position`, `Anrede`, `Geburtsdatum`, `Einstellung`, `Straße`, `Ort`, `Region`, `PLZ`, `Land`, `TelefonPrivat`, `DurchwahlBüro`, `Bemerkungen`, `Vorgesetzter`, `Groesse`) VALUES
	(2, 'Fuller', 'Andrew', 'Geschäftsführer', 'Herr', '1952-02-19', '1992-08-14', '908 W. Capital Way', 'Tacoma', 'WA', '98401', 'USA', '(206) 555-9482', '3457', 'Studium der Betriebswirtschaft an der University of Dallas; 1971 Doktorarbeit über Internationales Marketing. Andrew spricht fließend Französisch und Italienisch. Er versteht Deutsch und liest deutsche Zeitungen und Zeitschriften. Eintritt in die Firma als Verkaufsrepräsentant, 1992 Verkaufsleiter, Geschäftsführer seit 1993. Mitglied des Sales Management Roundtable und des Verbandes "Pacific Rim Importers".', 8, 1.84),
	(1, 'Davolio', 'Nancy', 'Vertriebsmitarbeiterin', 'Frau', '1948-12-08', '1992-05-01', '507 - 20th Ave. E.\r\nApt. 2A', 'Seattle', 'WA', '98122', 'USA', '(206) 555-9857', '5467', 'Studium mit Abschluß BA in Psychologie an der Colorado State University. Kurs "The Art of the Cold Call."  Mitglied des Clubs "Toastmasters International".', 2, 1.56),
	(3, 'Fuller', 'Janet', 'Vertriebsmitarbeiterin', 'Frau', '1963-08-30', '1992-04-01', '722 Moss Bay Blvd.', 'Kirkland', 'WA', '98033', 'USA', '(206) 555-3412', '3355', 'Studium mit Abschluß BS in Chemie vom Boston College (1984). Sie hat dort außerdem an dem Kurs "Betriebsführung und -organisation im Lebensmittel-Einzelhandel" teilgenommen. Eintritt in die Firma als Verkaufsassistentin 1991. Befördert zur Verkaufsrepräsentantin im Februar 1992.', 8, 1.81),
	(4, 'Peacock', 'Margaret', 'Vertriebsmitarbeiterin', 'Frau', '1937-09-19', '1993-05-03', '4110 Old Redmond Rd.', 'Redmond', 'WA', '98052', 'USA', '(206) 555-8122', '5176', 'Studium der Englischen Literatur am Concordia College mit Abschluß BA (1958).  Studium am American Institute of Culinary Arts mit Abschluß MA (1966). Margaret arbeitete in der Londoner Abteilung Juli bis November 1992.', NULL, 1.64),
	(5, 'Buchanan', 'Steven', 'Vertriebsmanager', 'Herr', '1955-03-04', '1993-10-17', '14 Garrett Hill', 'London', NULL, 'SW1 8JR', 'UK', '(71) 555-4848', '3453', 'Studium an der St. Andrews University, Scotland, mit Abschluß BSC (1976). Eintritt in die Firma als Verkaufsrepräsentant 1992. Steven nahm an einem Orientierungskurs in der Seattle Abteilung teil und kehrte dann auf seinen Posten im Londoner Büro zurück. Beförderung zum Verkaufsleiter März 1993. Steven Buchanan hat an mehreren Weiterbildungskursen teilgenommen, darunter "Erfolgreiches Telemarketing" und "Internationales Verkaufsmanagement". Er spricht fließend Französisch.', NULL, 1.9),
	(6, 'Suyama', 'Michael', 'Vertriebsmitarbeiter', 'Herr', '1963-07-02', '1993-10-17', 'Coventry House\r\nMiner Rd.', 'London', NULL, 'EC2 7JR', 'UK', '(71) 555-7773', '428', 'Abschlüsse: MA in Wirtschaft (Sussex University, 1983) und MBA in Marketing (University of California at Los Angeles, 1986). Weiterbildungskurse: Internationale Verkaufsstrategien sowie Zeit-Management für professionelle Verkaufspersonen. Er spricht fließend Japanisch und liest französische, portugiesische und spanische Fachliteratur, Zeitungen und Zeitschriften.', NULL, 1.55),
	(7, 'King', 'Robert', 'Vertriebsmitarbeiter', 'Dr.', '1960-05-29', '1994-01-02', 'Edgeham Hollow\r\nWinchester Way', 'London', NULL, 'RG1 9SP', 'UK', '(71) 555-5598', '465', 'Englischstudium an der University of Michigan, Abschluß 1992.  Vorher war Robert King ein Mitglied der amerikanischen Hilfsorganisation "Peace Corps". Eintritt in die Firma 1992. Kurs: "Selling in Europe". Versetzung 1993 in die Londoner Abteilung.', NULL, 1.78),
	(8, 'Callahan', 'Laura', 'Vertriebskoordinatorin', 'Frau', '1958-01-09', '1994-03-05', '4726 - 11th Ave. N.E.', 'Seattle', 'WA', '98105', 'USA', '(206) 555-1189', '2344', 'Studium mit Abschluß BA in Psychologie an der University of Washington. Kurs: Geschäftsfranzösisch. Laura liest französische Zeitschriften und Zeitungen.', NULL, 1.86),
	(9, 'Dodsworth', 'Anne', 'Vertriebsmitarbeiterin', 'Frau', '1966-01-27', '1994-11-15', '7 Houndstooth Rd.', 'London', NULL, 'WG2 7LT', 'UK', '(71) 555-4444', '452', 'Studienabschluß am St. Lawrence College mit BA. Sie spricht fließend Französisch und Deutsch.', NULL, 1.8);
